    form.get('Discharge').hideAndClear();
    form.get('PA, Type of assistive device or orthosis').hideAndClear();
    form.get('PA, Comments about assistive device or orthosis').hideAndClear();
    form.get('Lower Limb Assessment').hideAndClear();
    form.get('Upper Limb Assessment').hideAndClear();
    form.get('PA, Details of previous physiotherapy').hideAndClear();
    form.get('PA, Other type of assistive device').hideAndClear();
  }
